INSERT INTO `rpm_distro` VALUES (11, 'Development', 'dev', '5', 'fc5_dev', 'Downloads - Fedora Core 5 (development)', '<ul>\r\n  <li><b>Click on the links</b></li>\r\n  <li><a href="http://www.linux-ntfs.org/content/view/127/63/">Read the Instructions</a></li>\r\n  <li><a href="http://www.linux-ntfs.org/content/view/132/68/">Read the Release Notes</a></li>\r\n  <li><a href="http://wiki.linux-ntfs.org/doku.php?id=faq">Read the NTFS FAQ (in the Wiki) before asking for help</a></li>\r\n  <li><b>If you upgrade your kernel, you will need to install a new NTFS RPM</b></li>\r\n</ul>\r\n\r\n<p>\r\n  If you have a 64-bit machine, try looking in the <q>Contrib</q> section, below.<br />\r\n  If you have problems with the rpm,\r\n  <a href="http://www.linux-ntfs.org/content/view/124/60/">start here</a>.\r\n</p>\r\n\r\n<p style="border: 3px red solid; padding: 5px">\r\n  This section is now <b>closed</b> as Fedora Core 5 has entered testing phase.\r\n  If you are looking for RPM''s for FC5 try\r\n  <a href="http://www.linux-ntfs.org/content/view/157/83/">here<a/>\r\n</p>');
INSERT INTO `rpm_distro` VALUES (12, 'Development', 'test', '5', 'fc5_test', 'Downloads - Fedora Core 5 (test)', '<ul>\r\n  <li><b>Click on the links</b></li>\r\n  <li><a href="http://www.linux-ntfs.org/content/view/127/63/">Read the Instructions</a></li>\r\n  <li><a href="http://www.linux-ntfs.org/content/view/132/68/">Read the Release Notes</a></li>\r\n  <li><a href="http://wiki.linux-ntfs.org/doku.php?id=faq">Read the NTFS FAQ (in the Wiki) before asking for help</a></li>\r\n  <li><b>If you upgrade your kernel, you will need to install a new NTFS RPM</b></li>\r\n</ul>\r\n\r\n<p>\r\n  If you have a 64-bit machine, try looking in the <q>Contrib</q> section, below.<br />\r\n  If you have problems with the rpm,\r\n  <a href="http://www.linux-ntfs.org/content/view/124/60/">start here</a>.\r\n</p>\r\n\r\n<p style="border: 3px red solid; padding: 5px">\r\n  FC5 test rpms are now being maintained by <a href="http://sourceforge.net/users/snecklifter">snecklifter</a>. \r\n  Please do not contact flatcap regarding this section. Some rpm''s will be missing,\r\n  due to the temperamental nature of the rawhide tree. If you have comments or would\r\n  like to contribute rpm''s please email :<br />\r\n  <img src="http://www.linux-ntfs.org/images/stories/contactsneck.png" width="148" height="23" hspace="6" alt="Image" title="Image" border="0" />\r\n</p>\r\n\r\n<p>\r\n  The RPMs are built from the same source code as the Fedora kernels. I do\r\n  not have time to upload these daily in order to meet GPL requirements -\r\n  sorry. These are, however, available on the\r\n  <a href= "http://download.fedora.redhat.com/pub/fedora/linux/core/">Fedora Website</a>\r\n  or on one of the\r\n  <a href= "http://fedora.redhat.com/download/mirrors.html">Fedora Mirrors</a>.\r\n</p>');
