INSERT INTO `rpm_section` VALUES (1, 'normal rpms', 'NTFS RPMs (*.rpm)', NULL, 0, 1);
INSERT INTO `rpm_section` VALUES (2, 'contrib rpms', 'Contributed NTFS RPMs (*.rpm)', '<p>\r\n  If you can''t find an RPM for your version, you will have to\r\n  <a href= "http://www.linux-ntfs.org/content/view/126/62/">build your own</a>.\r\n  If you do, please\r\n  <a href= "http://www.linux-ntfs.org/content/view/20/39/">send me (Richard Russon) a copy</a>\r\n  and I''ll release them so others can benefit.\r\n</p>', 1, 2);
INSERT INTO `rpm_section` VALUES (3, 'contrib rpms (chris)', 'Contributed NTFS RPMs (*.rpm)', '<p>\r\n  If you can''t find an RPM for your version, you will have to\r\n  <a href= "http://www.linux-ntfs.org/content/view/126/62/">build your own</a>.\r\n  If you do, please send me (Chris Brown) a copy at the address above and I''ll\r\n  release them so others can benefit. The address is an image to try and\r\n  thwart spammers.\r\n</p>', 1, 3);
INSERT INTO `rpm_section` VALUES (4, 'contrib rpms (linuxant)', 'Contributed Linuxant NTFS RPMs (*.rpm)', '<p>\r\n  These NTFS RPMs are for\r\n  <a href= "http://www.linuxant.com/driverloader/wlan/full/downloads.php">Linuxant</a>\r\n  kernels.\r\n</p>\r\n\r\n<p>\r\n  If you can''t find an RPM for your version, you will have to\r\n  <a href= "http://www.linux-ntfs.org/content/view/126/62/">build your own</a>.\r\n  If you do, please\r\n  <a href= "http://www.linux-ntfs.org/content/view/20/39/">send me (Richard Russon) a copy</a>\r\n  and I''ll release them so others can benefit.\r\n</p>', 1, 4);
INSERT INTO `rpm_section` VALUES (5, 'kernel modules', 'NTFS Kernel Modules (*.o)', '<p>\r\n  You almost certainly don''t want these downloads. They are here for the\r\n  sake of completeness.\r\n</p>', 0, 5);
INSERT INTO `rpm_section` VALUES (6, 'source (redhat)', 'Source Code', '<p>\r\n  The RPMs are built from the same source code as the RedHat kernels. The\r\n  source is kept here for convenience, but you can also find it on the\r\n  <a href="http://ftp.redhat.com/pub/redhat/linux/">RedHat Website</a>.\r\n</p>', 0, 6);
INSERT INTO `rpm_section` VALUES (7, 'source (fedora)', 'Source Code', '<p>\r\n  The RPMs are built from the same source code as the Fedora kernels. The\r\n  source is kept here for convenience, but you can also find it on the\r\n  <a href="http://download.fedora.redhat.com/pub/fedora/linux/core/">Fedora Website</a>\r\n  or on one of the\r\n  <a href= "http://fedora.redhat.com/download/mirrors.html">Fedora Mirrors</a>.\r\n</p>', 0, 7);
